import React from "react";
import {Route,Routes,Link} from 'react-router-dom';
import DisplayAllCategory from "./Admin/DisplayAllCategory";
import Category from './Admin/Category';
import Product from './Admin/Product';
import Dashboard from './Admin/Dashboard';





function App(props) {
  return (
    <div >
      <Routes>
        <Route strict props={props.history} element= {Category} path="/category"/>
       <Route strict props={props.history} ee={DisplayAllCategory} path="/displayallcategory"/>
       <Route strict props={props.history} component={Dashboard} path="/dasboard" />
       <Route strict props={props.history} component={Product} path="/product" />





      </Routes>

    </div>
  );
}
export default App ;
